export function MainLayout({children}) {
    return (
        <>
        <nav>
            <Link className="navlink" href={'/'}>Home</Link>
            <Link className="navlink" href={'/about'}>About</Link>
            <Link className="navlink" href={'/posts'}>Posts</Link>
        </nav>
        <main>
            {children}
        </main>

        <style jsx>
            {`
                nav {
                    position: fixed;
                    left: 0;
                    right: 0;
                    height: 60px;
                    background: darkblue;
                }
                navlink {
                    color: white;

                }
            `}
        </style>
        </>
    )
}
